  return (
    <div>
      <div className="flex justify-center items-center flex-col py-10">
        <h1 className="text-center font-bold text-xl"> Your Plant </h1>
        <p> Status: Healthy </p>
        <img src="/plant.png" className="max-w-[70%]" />
      </div>

      <div className="flex flex-col justify-center items-center">
        {/* the camera component using a npm package; Ignored for now */}
        {/* <MyCamera /> */}
        <button className="mb-4 cursor-pointer bg-blue-500 text-white py-2 px-4 rounded hover:bg-blue-600 w-[40%]">
          Take a picture
        </button>

        <ImageUploader className="w-[40%]" />
      </div>
    </div>
  );
}

export default App;
